import { Component, ElementRef, HostListener, Renderer2 } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-services-product',
  templateUrl: './services-product.component.html',
  styleUrls: ['./services-product.component.css']
})
export class ServicesProductComponent {

  private scrollAnimationElement: HTMLElement;

  constructor(private route: ActivatedRoute, private renderer: Renderer2, private el: ElementRef) {}

  ngOnInit() {
    this.route.fragment.subscribe(fragment => {
      if (fragment) {
        const element = document.querySelector('#' + fragment);
        if (element) {
          element.scrollIntoView();
        }
      }
    });

    this.scrollAnimationElement = this.el.nativeElement.querySelector('.rotate');
  }

  @HostListener('window:scroll')
  onWindowScroll() {
    const scrollPos = window.innerHeight - this.scrollAnimationElement.getBoundingClientRect().top;

    if (scrollPos > 0) {
      this.renderer.addClass(this.scrollAnimationElement, 'animate');
    }
  }
}
